import React from 'react'
import Nav from '../nav-bar/Nav';
import TextRevealAni from '../animations_functions/TextRevealAni';
import styles from "./style.css";

function Logic() {
  const text = "Hello There Buddy";
  return (
    <>
      <Nav />
      <div className='h-screen flex justify-center'>

        <div className={styles.margin_top-25}>
          {/* creating an contain that has animations just like Typeform */}
          <TextRevealAni className='text-9xl' text={text} />
        </div>
      </div>
    </>
  )
}

export default Logic
